sequence = [int(s) for  s in sample.split(' ')]

# Longest increasing subsequence
subseq = [[min(sequence) - 1]]  # List of subsequences. Initilize with the value lower than lowest in subsequence to avoid dealing with edge checks
for n in sequence:
    i = len(subseq) - 1
    while i >= 0:
        # if n is greater than the last element in the previous subsequence, but less than the last in this subsequence then replace this subsequence with last+n
        if subseq[i - 1][-1] < n < subseq[i][-1]:
            subseq[i] = subseq[i-1].copy()
            subseq[i].append(n)
            break
        i -= 1

    if i == -1 and subseq[-1][-1] < n:  # append to the last subsequence (longest) if n is greater than its last element
        new_sq = subseq[-1].copy()
        new_sq.append(n)
        subseq.append(new_sq)

    # print(subseq)
print(' '.join(str(x) for x in subseq[-1][1:]))

# Longest decreasing subsequence
subseq = [[max(sequence) + 1]]  # Initilize with the value higher than highest in subsequence to avoid dealing with edge checks
for n in sequence:
    i = len(subseq) - 1
    while i >= 0:
        if subseq[i-1][-1] > n > subseq[i][-1]:
            subseq[i] = subseq[i-1].copy()
            subseq[i].append(n)
            break
        i -= 1

    if i == -1 and subseq[-1][-1] > n:
        new_sq = subseq[-1].copy()
        new_sq.append(n)
        subseq.append(new_sq)

    # print(subseq)

print(' '.join(str(x) for x in subseq[-1][1:]))
